import './App.css';
import { useEffect, useState } from 'react';
import axios from 'axios';

function App() {


  const API_KEY = '10f5fc043a0815d3b2db734dd151a90a';
  const url = "https://api.openweathermap.org/data/2.5/weather?q=${Buenos Aires}&appid=${API_KEY}&units=metric"
  const [cityarg, setCityArg] = useState('Buenos Aires')
  const [city, setCity] = useState(cityarg);


  useEffect(() => {
    axios.get(url)
  }, [] )

  const fetchData = () => {
    axios.get(`https://api.openweathermap.org/data/2.5/weather?q=${city}&appid=${API_KEY}&units=metric`)
  }



  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;
